  huge. Only 503 Charger Daytonas were ever built, and values for top examples with
  the 440 engine have cracked the $250,000 barrier in recent days, while models fitted
  with a 426/425 HEMI V8 are closing in on the $1 million mark. \n"
- "Related ImageExpand / Contract (Mecum) \n"
- |
  Mecum’s pre-auction estimate for the car is $150,000-$180,000. Not bad for something that cost $3,993 new and doesn’t even run.
