  \  \nRelated ImageExpand / Contract (Mecum) \nEven in its current condition, the
  payday at the end of a restoration is potentially huge. Only 503 Charger Daytonas
  were ever built, and values for top examples with the 440 engine have cracked the
  $250,000 barrier in recent days, while models fitted with a 426/425 HEMI V8 are
  closing in on the $1 million mark. \nRelated ImageExpand / Contract (Mecum) \nMecum’s
  pre-auction estimate for the car is $150,000-$180,000. Not bad for something that
  cost $3,993 new and doesn’t even run.\n\t\t\n\t\n\t\t\n \n   Advertisement\n\t   \n\n\t\t\t\t
